import React from 'react';

function HomePage() {
  return (
    <div>
      <div className='main-image'>
        <img src="https://www.fenrir-inc.com/wp/wp-content/themes/www.fenrir-inc.com/img/home/fenrir_logo.svg" />
      </div>
      <div>
        <h2>デザインと技術から生まれる創造性が、
            変わらない本質を追求する。
        </h2>
      </div>
    </div>
  )
};

export default HomePage;
